    internal fun shouldReturnBodyModified() {
        val httpHelper = Mockito.mock(HttpHelper::class.java)
        `when`(httpHelper.get(URL("http://www.reservasctp.es/reservas_diarias.php")))
            .thenReturn(htmlReturned)
        val legacyService = LegacyService(httpHelper)

        val bookings = legacyService.getBookings(null, "newEndpoint", "dateParamName")

        assertThat(bookings).isEqualTo(htmlExpected)
    }

